	router.get('/', handle(Users.getAll));

	router.post('/', handle(Users.create));

	router.get('/:id', handle(Users.getOne));

	router.put('/:id', handle(Users.update));

	router.delete('/:id', handle(Users.deleteUser));

	return router;
}

export default usersRouter;

