import express from 'express';

import mongoose, { Schema } from 'mongoose';

import bodyParser from 'body-parser';

//db Schemas

const usersModel = new Schema({
	email: {type: String, required: true},
	first_name: {type: String, required: true},
	last_name: {type: String, required: true},
	personal_phone: {type: String, required: true}
})

//controllers

usersModel.statics.getAll = async () => {

	const Users = mongoose.model('users');

	try {

		let data = await Users.find();

		return { status: 200, data};
	} catch(e) {
		return { status: 500, data: e };
	}
}

usersModel.statics.getOne = async (params) => {
	const Users = mongoose.model('users');

	try {
		let data = await Users.find({ _id:params.id });

		if(!data.length) return { status: 200, data: "User not found"};

		return { status: 200, data};
	} catch(e) {
		return { status:500, data: e};
	}
}

usersModel.statics.create = async (body) => {
	const Users = mongoose.model('users');

	const newUser = new Users({
		email: body.email,
		first_name: body.first_name,
		last_name: body.last_name,
		personal_phone: body.personal_phone
	});

	try {
		let data = await newUser.save();
		return { status: 200, data};
	} catch(e) {
		return { status:500, data: e};
	}
}

usersModel.statics.update = async(params, body) => {
	const Users = mongoose.model('users');

	const updatedUser = {
		email: body.email,
		first_name: body.first_name,
		last_name: body.last_name,
		personal_phone: body.personal_phone
	}

	try {
		let data = await Users.findOneAndUpdate({ _id: params.id }, updatedUser ,{ new: true });
		return { status: 200, data};
	} catch(e) {
		return { status:500, data:e};
	}

}

usersModel.statics.deleteUser = async(params, body) => {
	const Users = mongoose.model('users');

	try {
		let data = await Users.findOneAndDelete({ _id: params.id });
		if(!data) return { status: 200, data: 'User not found'};
		return { status: 200, data: `User with id ${params.id},successfully deleted.`}
	} catch(e) {
		return { status: 500, data: e};
	}
}


//db connection

const mongodb = async () => {
	mongoose.model('users', usersModel);

	mongoose.set('useFindAndModify', false);

	await mongoose.connect("mongodb://localhost/tv-assignment",{ useNewUrlParser: true});
}

//handler 

const handle = (controller) => {
	return async (req, res) => {
		const { method, params, body } = req;
		let response;

		switch(method) {
			case "GET":
			case "DELETE":
				response = await controller.call(null, params);
				break;

			case "POST":
				response = await controller.call(null, body);
				break;

				case "PUT":
				default:
					response = await controller.call(null, params, body);
					break;
		}
		const { status, data } = response;

		if(status != 200) {
			console.log(data);
		}

		res.status(status).send(data);
	}
}

//router

const usersRouter = () => {
	const Users = mongoose.model('users');

	var router = express.Router();

	router.get('/', handle(Users.getAll));

	router.post('/', handle(Users.create));

	router.get('/:id', handle(Users.getOne));

	router.put('/:id', handle(Users.update));

	router.delete('/:id', handle(Users.deleteUser));

	return router;
}


//app

mongodb()
	.then( async () => {
		const app = express();

		app.use(bodyParser.json());
		app.use('/users', usersRouter());

		app.listen(8080, err => {
			if(err) {
				console.log(err);
			} else {
				console.log(`Server Running - Listening on port 8080`);
			}
		})
	})
	.catch(e =>{
		console.log('MONGODB: ', "Failed to connect");
		console.log(e);
	});
